import React from "react";
import { Helmet } from "react-helmet";
import comingSoonImg from "../Images/comingSoon.png";

function ComingSoon() {
  return (
    <div className="text-center">
      <Helmet>
        <title>ComingSoon</title>
      </Helmet>
      <img src={comingSoonImg} />
      <h1>COMING SOON....</h1>
    </div>
  );
}
export default ComingSoon;
